import React, { Component } from 'react'
import { Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Badge, Button,  Modal, ModalHeader, ModalBody, ModalFooter } from 'reactstrap';
import Register from './Register'

export default class Account extends Component {

  constructor(props) {
    super(props);
    this.state = {
      modal: false
    };

    this.toggle = this.toggle.bind(this);
  }

  toggle() {
    this.setState(prevState => ({
      modal: !prevState.modal
    }));
  }

  render() {
    return (
        <div>
        <Card class="p-2 flex-shrink-1 bd-highlight" className="text-center" 
        style={{ marginTop:'40px', width:'346px', height:'381px', borderRadius:'5px', boxShadow:'0 4px 4px 0 rgba(0, 0, 0, 0.1)  ', border:'solid 1px #d6d6d6' ,backgroundColor:'#ffffff'}}>
          <CardImg style={{backgroundColor:'d6d6d6', margin:'auto', marginTop:'20px', marginBottom:'30px', width:'150px', height:'150px', borderRadius:'50%'}}  
          src="https://scontent.fcgk8-2.fna.fbcdn.net/v/t1.0-9/37228699_10156511912949419_5427734426052198400_n.jpg?_nc_cat=106&_nc_eui2=AeFbW0UNjyUU6wUYr2IRN9OeP8hreReeKw5JhLn4zpkqOk1EoX7p-oyHW8DTrHt5IrPnY0tK6xlY0Q6fIY6iv9XgAzUKHS8I46Du69aZ0qCGvQ&_nc_ht=scontent.fcgk8-2.fna&oh=c180ed12f4d6e241827c9bed4879df13&oe=5D034823"
           alt="Card image cap" />
          <CardBody>
            <CardTitle style={{textAlign:'center'}}><h2 style={{color:'#2e2e2e', fontSize:'30px', height:'36px'}}>Hi, Bro</h2></CardTitle>
            <CardSubtitle style={{textAlign:'center', marginBottom:'20px', height:'22px', fontSize:'18px', color:'#8c8c8c'}}>Welcome to The GarageLife</CardSubtitle>




             <Button 
            style={{width: '171.4px', padding:'10px',
                height: '40px', marginTop:'30px',
                borderRadius: '99px',
                backgroundColor: '#e07e0c',
                fontFamily: 'Roboto',
                fontSize: '16px',
                fontWeight: '500',
                fontStyle: 'normal',
                fontStretch: 'normal',
                lineHeight: 'normal',
                letterSpacing: 'normal',
                color: '#ffffff'
            }}
            ><h2 style={{ 

              width:'126px', 
              textAlign:'center',
              margin:'auto',
              fontSize:'20px',
              fontWeight:'500px',
              color:'#ffffff', 
              fontFamily:'Roboto'
             }} onClick={this.toggle}>{this.props.buttonLabel} Create Article</h2></Button>



             <Modal  isOpen={this.state.modal} toggle={this.toggle} 
      className={this.props.className}>
        <ModalHeader style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} toggle={this.toggle}></ModalHeader>
        <ModalBody style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff'

         }} >
          <Register />
        </ModalBody>
        <ModalFooter style={{
  width: '675px',
  height: 'auto',
  backgroundColor: '#ffffff', textAlign:'center'

         }} >
         <h4 style={{
  backgroundColor: '#ffffff', color: '#838383'
         }} >Already have an account ?</h4> <h4 style={{
          backgroundColor: '#ffffff', color: '#2e4ffc'
                 }}>Login</h4>
        </ModalFooter>
      </Modal>

            </CardBody>
        </Card>
      </div>
    )
  }
}
